import React from 'react';
import Chart from './Chart';
import './App.css';

const sampleData = [
  { time: '2023-01-01', open: 100, high: 105, low: 95, close: 102 },
  { time: '2023-01-02', open: 102, high: 108, low: 100, close: 107 },
  { time: '2023-01-03', open: 107, high: 110, low: 104, close: 106 },
  { time: '2023-01-04', open: 106, high: 109, low: 102, close: 108 },
  { time: '2023-01-05', open: 108, high: 112, low: 105, close: 111 },
  { time: '2023-01-06', open: 111, high: 114, low: 109, close: 113 },
  { time: '2023-01-07', open: 113, high: 115, low: 110, close: 112 },
  { time: '2023-01-08', open: 112, high: 116, low: 108, close: 115 },
  { time: '2023-01-09', open: 115, high: 118, low: 113, close: 117 },
  { time: '2023-01-10', open: 117, high: 120, low: 115, close: 119 },
];

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>TradingView Chart MVP</h1>
        <Chart data={sampleData} />
      </header>
    </div>
  );
}

export default App;
